(1, 'renatio::invoice', 'Invoice', '<html>\r\n    <head>\r\n        <style type=\"text/css\" media=\"screen\">\r\n            {{ css|raw }}\r\n        </style>\r\n    </head>\r\n    <body>\r\n       \r\n        {{ content_html|raw }}\r\n    </body>\r\n</html>', '@font-face {\r\n    font-family: \'Open Sans\';\r\n    src: url(\'plugins/renatio/dynamicpdf/assets/fonts/OpenSans-Regular.ttf\');\r\n}\r\n\r\n@font-face {\r\n    font-family: \'Open Sans\';\r\n    font-weight: bold;\r\n    src: url(\'plugins/renatio/dynamicpdf/assets/fonts/OpenSans-Bold.ttf\');\r\n}\r\n\r\n@font-face {\r\n    font-family: \'Open Sans\';\r\n    font-style: italic;\r\n    src: url(\'plugins/renatio/dynamicpdf/assets/fonts/OpenSans-Italic.ttf\');\r\n}\r\n\r\n@font-face {\r\n    font-family: \'Open Sans\';\r\n    font-style: italic;\r\n    font-weight: bold;\r\n    src: url(\'plugins/renatio/dynamicpdf/assets/fonts/OpenSans-BoldItalic.ttf\');\r\n}\r\n\r\n@page {\r\n    margin: 0;\r\n    padding: 0;\r\n}\r\n\r\n\r\n@page {\r\n    size:A4;\r\n    margin-left: 0px;\r\n    margin-right: 0px;\r\n    margin-top: 0px;\r\n    margin-bottom: 0px;\r\n    margin: 0;\r\n    -webkit-print-color-adjust: exact;\r\n}\r\n\r\nbody {\r\n    font-family: \'Open Sans\', sans-serif;\r\n    font-size: 14px;\r\n    background: url(\'http://cpitvc.gov.co/certificados_consejo_opt.png\');\r\n\r\n    background-size: cover; \r\n    background-repeat: no-repeat;\r\n    background-position: top left;\r\n    display:block;    \r\n    height:1115px;\r\n    \r\n \r\n    \r\n}\r\n\r\n.secondText b{\r\n    text-transform: uppercase;\r\n}\r\n\r\nbody .container{	\r\n	padding:180px 100px;	\r\n}\r\n\r\nbody p{\r\n    line-height:15px;\r\n}\r\n\r\nbody h2{	\r\n	font-weight: bold;\r\n	text-align: center;\r\n	margin:40px;\r\n}\r\n\r\nbody .center_section{\r\n	margin:50px 0;\r\n}', '2019-08-16 19:43:36', '2019-08-17 03:45:58');

