(1, 1, 'renatio::invoice', 'Invoice', 'Example Invoice Template', '<div class=\"content\">\r\n    <p class=\"small-txt\">Acme Company • Admin Person • Test Street • 31335 Berlin</p>\r\n\r\n    <p class=\"company-info\">\r\n        <strong>Happy Customer - Acme GmbH</strong><br>\r\n        <strong>Elbstr. 2</strong><br>\r\n        <strong>041340 Berlin</strong>\r\n    </p>\r\n\r\n    <p class=\"customer-info\">\r\n        <strong>Kundennummer:</strong> 1211<br>\r\n        <strong>Rechnungsnummer:</strong> 2015-ADG-1612<br>\r\n        <strong>Datum:</strong> 18.03.2015<br>\r\n        <strong>Zahlungsbedingungen:</strong> 2 Tage ohne Abzug<br>\r\n        <strong>Fällig am:</strong> 20.03.2015\r\n    </p>\r\n    <table class=\"summary\">\r\n        <tr>\r\n            <th>Menge</th>\r\n            <th>Beschreibung</th>\r\n            <th>Preis</th>\r\n            <th>Anzahlung 30%</th>\r\n        </tr>\r\n        <tr>\r\n            <td class=\"col-1\">1</td>\r\n            <td class=\"col-2\">4 Holzfenster</td>\r\n            <td class=\"col-3\">26.653,69 &euro;</td>\r\n            <td class=\"col-4\">7.996,11 &euro;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class=\"col-1\">1</td>\r\n            <td class=\"col-2\">4 Holzfenster</td>\r\n            <td class=\"col-3\">26.653,69 &euro;</td>\r\n            <td class=\"col-4\">7.996,11 &euro;</td>\r\n        </tr>\r\n        {% for i in 0..5 %}\r\n            <tr>\r\n                <td class=\"col-1\">&nbsp;</td>\r\n                <td class=\"col-2\"></td>\r\n                <td class=\"col-3\"></td>\r\n                <td class=\"col-4\"></td>\r\n            </tr>\r\n        {% endfor %}\r\n        <tr class=\"sum-price\">\r\n            <td colspan=\"3\" class=\"col-3 bt\">Netto</td>\r\n            <td class=\"col-4\">7.996,11 &euro;</td>\r\n        </tr>\r\n        <tr class=\"sum-price\">\r\n            <td colspan=\"3\" class=\"col-3\">zzgl. 19% MwSt.</td>\r\n            <td class=\"col-4\">1.519,26 &euro;</td>\r\n        </tr>\r\n        <tr class=\"sum-price\">\r\n            <td colspan=\"3\" class=\"col-3\"><strong>Gesamt</strong></td>\r\n            <td class=\"col-4\">9.515,37 &euro;</td>\r\n        </tr>\r\n    </table>\r\n    <p><strong>Vielen Dank für Ihren Auftrag</strong></p>\r\n\r\n    <p>Gerichtsstand für alle Ansprüche aus diesem Auftrag ist Berlin.</p>\r\n</div>', '2019-08-16 19:43:36', '2019-08-16 19:43:36'),
(2, 1, 'cpitvc', 'cpitvc', '', '<html>\r\n    <head>\r\n        <style type=\"text/css\" media=\"screen\">\r\n            {{ css|raw }}\r\n        </style>\r\n\r\n\r\n    </head>\r\n    \r\n        <div class=\"container\">\r\n            <p class=\"firtsText\">El Director Ejecutivo, en uso de las facultades estatutarias del Concejo Profesional de\r\n            Ingeniería de Transporte y Vías de Colombia creado por la ley 33 de 1980 y la ley 842 de\r\n            2002.</p>\r\n\r\n            <h2>HACE CONSTAR</h2>\r\n\r\n            <p class=\"secondText\">\r\n                Que <b>{{nombres}} {{apellidos}}</b> identificado(a) con la Cédula de Ciudadanía No <b>{{identificacion}}</b>, figura matriculado(a) como <b>{{titulo}}</b> bajo el número de matrícula {{matricula}}, según resolución <b>{{resolucion}}</b> del <b>{{fecha_resolucion}}</b>, expedida por el Consejo Profesional de Ingeniería de Transportes y Vías de Colombia, con base en el título conferido por la <b>{{universidad}}</b>\r\n\r\n            </p>\r\n\r\n            <div class=\"center_section\">\r\n                <p> Que la Matrícula se encuentra vigente.</p>\r\n                <p>Que el (la) ingeniero(a) no registra antecedentes displinarios en el ejercicio profesional.</p>\r\n                <p>Que el presente certificado tiene una vigencia hasta la fecha {{fecha_vigencia}} </p>\r\n                <p>Se expide en Bogotá D.C, a los <b>{{dias}}</b> dias del mes <b>{{ mes}}</b> del  <b>{{ ano}}</b> </p>\r\n            </div>\r\n\r\n            <div class=\"footer_section\">\r\n                <p>\r\n                    Si el certificado es solicitado por una persona diferente al titular, este no podra ser utilizado para presentarlo en hojas de vida sin autorización del ingeniero, según lo contemplado en la ley 842 de 2003, articulo 53, literal D. \r\n                </p>\r\n\r\n                <p>Este certificado se expide con base en la ley 842 de 2003, artículo 6, parágrafo único.</p>\r\n            </div>\r\n\r\n        </div>\r\n\r\n</html>', '2019-08-16 19:48:26', '2019-08-17 02:59:28');

